import Card from './Card';

const CardList=({Profile})=>{
  const CardArrays=Profile.map((students,i)=>{
return <Card id={students[i].id} name={Profile[i].name} user={Profile.username} email={Profile[i].email}/>
   });

    return(
    <div>
    {CardArrays}
    </div>
    );
}
